'use strict';
Promise.all([new FontFace('Exo 2',
    'url(data:;base64,)'
    , {
        style: 'normal', weight: '400'
    }).load(), new FontFace('Exo 2', 
    'url(data:;base64,)'
    , {
        style: 'italic', weight: '600'
    }).load(), new FontFace('Venera', 
    'url(data:;base64,)'
    , {
        style: 'normal', weight: '700'
    }).load()]).then(f => f.forEach(p => document.fonts.add(p)));